<title>chandrashekaraya nama ohm :</title>

chandra shekaraya nama ohm..
gangadharaya nama ohm..
ohm nama sivaya nama ohm..
hara haraya nama ohm..
siva sivaya namaohm..
chandra moulishwaraya nama ohm..[ chandra shekaraya]
